import logo from './logo.svg';
import './App.css';
import Header from './Components/Header/Header';
import Shop from './Components/Shop/Shop';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'



function App() {

  return (
    <div className="App">
      <Header></Header>
      <Router>
        <Switch>
          <Route path="/shop">
             <Shop></Shop>
          </Route>

        </Switch>
      </Router>


    </div>
  );
}


export default App;
